	// Objects real, imag, and horn_table came from sitepoint.com [Using Fourier Transforms with the Web Audio API]
	// This basically imitates the sound of an organ. Skewl. :)
	
	let audio_context = new (AudioContext || webkitAudioContext)();
	let horn_table = audio_context.createPeriodicWave(real, imag);
	let oscillator = audio_context.createOscillator();
	let audio_gain = audio_context.createGain();
	
	let piano_tiles = [];
	let canvas = document.createElement("canvas");
	let ctx = canvas.getContext("2d");
	canvas.height = 600;
	canvas.width = 800;
	canvas.style.position = "absolute";
	canvas.style.left = "0";
	canvas.style.right = "0";
	canvas.style.top = "0";
	canvas.style.bottom = "0";
	canvas.style.margin = "auto";
	canvas.style.border = "1px solid black";
	
	class organ{
		constructor(x, y, w, h, id){
			this.x = x;
			this.y = y;
			this.w = w;
			this.h = h;
			this.id = id;
			piano_tiles.push({x: x, y: y, w: w, h: h, id: id});
		}
		
		in(freq){
			// Set the oscillator frequency
			oscillator.frequency.value = freq;
			
			// Cancel the overlapping gained volume
			audio_gain.gain.cancelScheduledValues(audio_context.currentTime);
			
			// Set current gain volume
			audio_gain.gain.setValueAtTime(audio_gain.gain.value, audio_context.currentTime);
			
			// Ramp volume to X in N seconds (where X is the percentage of volume increase, 
			// and N is the span of seconds before ramping volume to X percent)
			audio_gain.gain.linearRampToValueAtTime(1, audio_context.currentTime + 0.01);
		}
	
		out(){
			// Explanation same as above. Read it.
			audio_gain.gain.cancelScheduledValues(audio_context.currentTime);
			audio_gain.gain.setValueAtTime(audio_gain.gain.value, audio_context.currentTime);
			audio_gain.gain.linearRampToValueAtTime(0, audio_context.currentTime + 0.5)
		}
		
		draw(){
			let x = 30;
			ctx.clearRect(0, 0, 1000, 1000);
			
			for(x = 25; x <= 700; x+=95){
				ctx.beginPath();
				ctx.rect(x, 20, 90, 400);
				ctx.stroke();
				ctx.closePath();
			}
		}
	}
	
	window.onload = () => {
		let obj = new organ();
		document.body.addEventListener("keydown", e => {
			switch(e.keyCode){
				case 65: obj.in(261.63); break; // C-Major
				case 87: obj.in(277.18); break; // C# / Db
				case 83: obj.in(293.66); break; // D-Major
				case 69: obj.in(311.13); break; // D# / Eb
				case 68: obj.in(329.63); break; // E-Major
				case 70: obj.in(349.23); break; // F-Major
				case 84: obj.in(369.99); break; // F# / Gb
				case 71: obj.in(392.00); break; // G-Major
				case 89: obj.in(415.30); break; // G# / Ab
				case 72: obj.in(440.00); break; // A-Major
				case 85: obj.in(466.16); break; // A# / Bb
				case 74: obj.in(493.88); break; // B-Major
				case 75: obj.in(523.25); break; // C-Major (1 octave higher)
			}
			console.log(e.keyCode)
		});
		
		document.body.addEventListener("keyup", () => obj.out());
		obj.draw();
		
		oscillator.setPeriodicWave(horn_table);
		oscillator.start();
		audio_gain.gain.linearRampToValueAtTime(0, 0);
		oscillator.connect(audio_gain);
		audio_gain.connect(audio_context.destination);
		document.body.appendChild(canvas);
	}
